import React, { useEffect, useState } from 'react';
import axios from 'axios';

const SessionList = () => {
    const [sessions, setSessions] = useState([]);

    useEffect(() => {
        const fetchSessions = async () => {
            try {
                const response = await axios.get('http://localhost:4000/api/sessions/list');
                setSessions(response.data);
            } catch (error) {
                console.error(error);
            }
        };
        fetchSessions();
    }, []);

    return (
        <div>
            <h1>Oturum Listesi</h1>
            {sessions.map((session) => (
                <div key={session._id}>
                    <h2>{session.title}</h2>
                    <p><strong>Tarih:</strong> {new Date(session.date).toLocaleDateString()}</p>
                    <p><strong>Zaman:</strong> {session.time}</p>
                    <p><strong>Tür:</strong> {session.type}</p>
                    <p><strong>Yer:</strong> {session.location}</p>
                    <p><strong>Oturum Kodu:</strong> {session.code}</p>
                    <p><strong>Konuşmacı:</strong> {session.speaker}</p>
                    <p><strong>Oturum Başkanı:</strong> {session.sessionChair}</p>
                    <p><strong>Açıklama:</strong> {session.description}</p>
                </div>
            ))}
        </div>
    );
};

export default SessionList;
